import { Link, NavLink } from "react-router-dom";
import Logo from "../../assets/lightCubeLogo.png";
import { useState } from "react";
import { sideIcons } from "../../Constants";

const Navigator = () => {
  const [navOpen, setNavOpen] = useState(true);

  const navToggle = () => {
    setNavOpen((navOpen) => !navOpen);
  };

  return (
    <header className="fixed left-0 bottom-3 w-full px-12 text-center z-50">
      <nav
        className={`bg-slate-900 overflow-hidden h-[48px] inline-flex items-center justify-center p-1 border-2 transition-all ${
          navOpen ? "w-full gap-x-5" : "w-[48px] rotate-0"
        } border-slate-50 rounded-full`}
      >
        <div className={`grid grid-cols-5 absolute`}>
          {sideIcons.map((item, index) => (
            <>
              <NavLink
                exact
                activeclassname="active"
                className={`text-2xl flex-fullcenter relative group transition-all displayTrans ${
                  navOpen ? "visible opacity-100" : "invisible opacity-0"
                }`}
                key={index}
                to={item.path}
              >
                <i
                  className={`fa-duotone ${item.icon} transition-all group-hover:opacity-0`}
                ></i>
                <span className="absolute transition-all bottom-[-100%] w-[200%] text-center text-xs text-slate-50 opacity-0 group-hover:opacity-100 group-hover:bottom-[15%]">
                  {item.label}
                </span>
              </NavLink>
              {index == 1 && (
                <button
                  onClick={navToggle}
                  className="rounded-full focus-visible:allunset"
                >
                  <img
                    src={Logo}
                    alt="logo"
                    className={`w-8 transition-all ${
                      navOpen ? "rotate-180" : "rotate-0"
                    }`}
                  />
                </button>
              )}
            </>
          ))}
        </div>
      </nav>
    </header>
  );
};

export default Navigator;
